import React from 'react'
import TuneIcon from '@material-ui/icons/Tune';

function Filter() {

    const showList = () =>{
        console.log('running');
        document.getElementsByClassName('btmFilter').style.display='block'
    }

    return (
        <div className="Filter" container>
            <div className="topFilter">
                 <p>My Feed</p>
                 <TuneIcon size="small" onClick={showList} style={{color:'#000'}}/>
            </div>
            <div className="btmFilter" id="btmFilterId">
                <p>Category</p>
                <p>Last Week</p>
            </div>
        </div>
    )
}

export default Filter
